import React, { Component } from 'react'
import {
  Header,
  Button
} from "semantic-ui-react";

style = { 
    height: "10em",
    position: "relative"
 }

export default class LandingPage extends Component {
  render() {
    return (
      <div style={style}>
        <Header> Search For Prospects Instantly </Header>
        <Button> Login </Button>
        <Button> New User </Button>
      </div>
    )
  }
}
